    [],nt"revision_timestamp": "2016-08-20T09:39:31.286046",nt"name": "ridgefield-complex-invasive-plant-edrr-search",nt"isopen":
    false,nt"url": null,nt"notes": "Much of this search will be conducted in
    woodland and forest habitat on foot. Some areas will be searched comprehensively
    for the first time, especially oak, deciduous and coniferous forest areas. Search
    will focus on the following species in conservation target habitats: yellow flag
    iris, purple loosestrife, and Japanese knotweed in floodplain wetlands, creeks and
    river shorelinesu037e shiny geranium and old manu2019s beard in oak woodland and
    sandy riparian forestu037e slenderflower thistle and knapweeds along roadsides and
    grassland/pastures, and other watch species as encountered such as garlic mustard.
    Volunteers including licensed applicators will search and map, largely on foot or
    by ATV and canoe, and treat small infestations for ED/RR (< 5 acres). Most of the
    project funds(60%)will be spent in JulySeptember of FY 14. The remaining 30% will
    be spent during thewoodland/forest search work which will need to take place during
    the FY 15 dormant season(Oct early Mar).",nt"license_title": "License Not
